import React from "react";
import image1 from "../Images/Image1.png"

const TextBox1 = () =>{
    return(
        <>
            <div className="col-lg-6 col-md-12 ">
            <h4>Welcome to Al-aSR Group</h4>
            <h3>Providing Innovative & Sustainable Agriculture Solutions</h3>
            <p>We believe in providing safe and effective pest control solutions for our customers. Our team uses only the safest and most effective products to eliminate pests from your property and crops. We take the health and safety of your family, pets, and the environment seriously, and our eco-friendly solutions are designed to minimize any impact. Our expert technicians are trained to develop customized solutions that are tailored to your specific needs, so you can trust us to provide effective and safe pest control services.</p>
            
            </div>
            <div className="col-lg-6 col-md-12">
            <div className="textBox-img">
                <img src={image1} alt="" />
            </div>
            
            </div>
        </>

    )
}

export default TextBox1;
